import React from 'react';
import CheckVisaWrapper from './CheckVisa.style';

const CheckVisaItem = ({
    question,
    children
}) =>{
    return (
        <CheckVisaWrapper>
            <CheckVisaWrapper>
                <p> {question} </p>
                <p> {children} </p>
            </CheckVisaWrapper>
        </CheckVisaWrapper>
    )
}

export default CheckVisaItem;
